import React, { Component } from 'react'

class Results extends Component {
  render() {
    return (
        <div className="results-box">
          <div className="container">
            <h3>Results:</h3>
            <ul>
            {this.props.search.map((item,i) => {
              return <li key={i}>{item}</li>;
            })}
            </ul>

            <iframe width="560" height="315" src="https://www.youtube.com/embed/B7PnQBn5k_E" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>

          </div>
        </div>
    );
  }
}
export default Results
